/* Procedure structure for procedure `addBankCard` */

/*!50003 DROP PROCEDURE IF EXISTS  `addBankCard` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `addBankCard`(userIdx int(11),accountx VARCHAR(30),namex VARCHAR(30),bankTypex INT(2))
BEGIN
	INSERT INTO bankbindlist(userId,account,name,bankType) VALUES(userIdx,accountx,namex,bankTypex);
	SELECT LAST_INSERT_ID() as rcode;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `AddGold` */

/*!50003 DROP PROCEDURE IF EXISTS  `AddGold` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `AddGold`(userIdx INT (11),goldx Int (11),change_typex int(2))
BEGIN
	DECLARE scorex INT DEFAULT -1;
	SELECT score INTO scorex FROM userinfo_imp WHERE userId = useridx;
	IF scorex = -1 THEN
		SELECT 0 AS rcode;
	ELSE
		UPDATE userinfo_imp SET score=score+goldx WHERE userId = userIdx;
		INSERT INTO score_changelog(userid,score_before,score_change,score_current,change_type,isOnline) VALUES(userIdx,scorex,goldx,scorex + goldx,change_typex,0);
		SELECT 1 AS rcode;
	END IF;
   END */$$
DELIMITER ;

/* Procedure structure for procedure `AddGoldSub` */

/*!50003 DROP PROCEDURE IF EXISTS  `AddGoldSub` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `AddGoldSub`(userIdx INT (11),goldx INT (11),change_typex INT(2))
BEGIN
	DECLARE scorex INT DEFAULT -1;
	SELECT score INTO scorex FROM userinfo_imp WHERE userId = useridx;
	IF scorex = -1 or scorex < (goldx * -1) THEN
		SELECT 0 AS rcode;
	ELSE
		UPDATE userinfo_imp SET score=score+goldx WHERE userId = userIdx;
		INSERT INTO score_changelog(userid,score_before,score_change,score_current,change_type,isOnline) VALUES(userIdx,scorex,goldx,scorex + goldx,change_typex,0);
		SELECT 1 AS rcode;
	END IF;
    END */$$
DELIMITER ;

