/* Procedure structure for procedure `update_recharge_first` */

/*!50003 DROP PROCEDURE IF EXISTS  `update_recharge_first` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `update_recharge_first`(userIdx INT(11),goodsid int(2))
BEGIN
	SELECT FIRST,anyFirst,daytime,goods1,goods2,goods3,goods4,goods5 INTO @first,@anyFirst,@dtimex,@goods1,@goods2,@goods3,@goods4,@goods5 FROM recharge_first WHERE userId = userIdx;
	SET @c_anyFirst = 0;
	SET @c_first = 0;
	SET @c_goods1 = 0;
	SET @c_goods2 = 0;
	SET @c_goods3 = 0;
	SET @c_goods4 = 0;
	SET @c_goods5 = 0;
	-- 是否为当天
	IF TO_DAYS(@dtimex)=TO_DAYS(NOW()) THEN
		-- 当天登录，当天充值
		if goodsid = 1 then
			UPDATE recharge_first SET anyFirst = 1, goods1 = 1 WHERE userId = userIdx;
			IF @anyFirst = 0 THEN
				SET @c_anyFirst = 1;
				SET @anyFirst = 1;
			END IF;
			if @goods1 = 0 then
				SET @c_goods1 = 1;
				SET @goods1 = 1;
			end IF;
			
		elseif goodsid = 2 then
			UPDATE recharge_first SET anyFirst = 1, goods2 = 1 WHERE userId = userIdx;
			IF @anyFirst = 0 THEN
				SET @c_anyFirst = 1;
				SET @anyFirst = 1;
			END IF;
			IF @goods2 = 0 THEN
				SET @c_goods2 = 1;
				SET @goods2 = 1;
			END IF;
		ELSEIF goodsid = 3 THEN
			UPDATE recharge_first SET anyFirst = 1,goods3 = 1 WHERE userId = userIdx;
			IF @anyFirst = 0 THEN
				SET @c_anyFirst = 1;
				SET @anyFirst = 1;
			END IF;
			IF @goods3 = 0 THEN
				SET @c_goods3 = 1;
				SET @goods3 = 1;
			END IF;
		ELSEIF goodsid = 4 THEN
			-- 充 100 
			UPDATE recharge_first SET anyFirst = 1,FIRST = 1,goods4 = 1  WHERE userId = userIdx;
			IF @first = 0 THEN
				SET @c_first = 1;
				SET @first = 1;
			END IF;
			IF @anyFirst = 0 THEN
				SET @c_anyFirst = 1;
				SET @anyFirst = 1;
			END IF;
			IF @goods4 = 0 THEN
				SET @c_goods4 = 1;
				SET @goods4 = 1;
			END IF;
		ELSEIF goodsid = 5 THEN
			UPDATE recharge_first SET anyFirst = 1,goods5 = 1 WHERE userId = userIdx;
			IF @anyFirst = 0 THEN
				SET @c_anyFirst = 1;
				SET @anyFirst = 1;
			END IF;
			IF @goods5 = 0 THEN
				SET @c_goods5 = 1;
				SET @goods5 = 1;
			END IF;
		end if;
		-- SELECT @c_first AS 'c_first', @c_anyFirst AS 'c_any' , @first AS 'first', @anyFirst AS 'any',@c_goods1 as 'c_goods1',@goods1 AS 'goods1',@c_goods2 AS 'c_goods2',@goods2 AS 'goods2',@c_goods3 AS 'c_goods3',@goods3 AS 'goods3',@c_goods4 AS 'c_goods4',@goods4 AS 'goods4',@c_goods5 AS 'c_goods5',@goods5 AS 'goods5';
	ELSE
		IF goodsid = 1 THEN
			SET @c_anyFirst = 1;
			SET @anyFirst = 1;
			SET @c_goods1 = 1;
			SET @goods1 = 1;
		ELSEIF goodsid = 2 THEN
			SET @c_anyFirst = 1;
			SET @anyFirst = 1;
			SET @c_goods2 = 1;
			SET @goods2 = 1;
		ELSEIF goodsid = 3 THEN
			SET @c_anyFirst = 1;
			SET @anyFirst = 1;
			SET @c_goods3 = 1;
			SET @goods3 = 1;
		ELSEIF goodsid = 4 THEN
			-- 充 100
			UPDATE recharge_first SET anyFirst = 1,FIRST = 1 WHERE userId = userIdx;
			SET @c_first = 1;
			SET @first = 1;
			SET @anyFirst = 1;
			SET @c_anyFirst = 1;
			SET @c_goods4 = 1;
			SET @goods4 = 1;
		ELSEIF goodsid = 5 THEN
			SET @c_anyFirst = 1;
			SET @anyFirst = 1;
			SET @c_goods5 = 1;
			SET @goods5 = 1;
		END IF;
	
		-- 不是当天，登录与充值不同天
		-- SELECT @c_first AS 'c_first', @c_anyFirst AS 'c_any' , @first as 'first', @anyFirst as 'any';
	END IF;
	
	SELECT @c_first AS 'c_first', @c_anyFirst AS 'c_any' , @first AS 'first', @anyFirst AS 'any',@c_goods1 AS 'c_goods1',@goods1 AS 'goods1',@c_goods2 AS 'c_goods2',@goods2 AS 'goods2',@c_goods3 AS 'c_goods3',@goods3 AS 'goods3',@c_goods4 AS 'c_goods4',@goods4 AS 'goods4',@c_goods5 AS 'c_goods5',@goods5 AS 'goods5';
    END */$$
DELIMITER ;

/* Procedure structure for procedure `useLoginCode` */

/*!50003 DROP PROCEDURE IF EXISTS  `useLoginCode` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `useLoginCode`(logincodex VARCHAR(40))
BEGIN
	SET @loginidx = 0;
	SET @timeL = "";
	
	SELECT loginid,loginDate INTO @loginidx,@timeL FROM logintemp WHERE logincode = logincodex;
	SELECT TIMESTAMPDIFF(DAY,@timeL,NOW()) INTO @flag;
	IF @flag = 0 THEN
		SELECT *,1 AS rcode FROM newuseraccounts WHERE Id=@loginidx;
	ELSE
		SELECT 0 AS rcode;
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `weixinCreateUser` */

/*!50003 DROP PROCEDURE IF EXISTS  `weixinCreateUser` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `weixinCreateUser`(Accountx VARCHAR(50),Passwordx VARCHAR(32),nicknamex VARCHAR(40),scorex INT(20),px VARCHAR(20),phoneNox VARCHAR(13),emailx VARCHAR(20),sexx INT(1),cityx VARCHAR(20),countryx VARCHAR(20),provincex VARCHAR(20),headimgurlx VARCHAR(200),languagex VARCHAR(10),logincodex VARCHAR(40),ChannelTypex VARCHAR(30),bindUserId VARCHAR(30),did VARCHAR(20))
BEGIN
	SET @recordcount = 0;
	set @ag = 1;
	SELECT Id INTO @recordcount FROM newuseraccounts WHERE Account = Accountx;
	IF @recordcount <= 0 THEN
		INSERT INTO newuseraccounts(Account,PASSWORD,nickname,score,p,phoneNo,email,sex,city,province,country,headimgurl,LANGUAGE,ChannelType) VALUES(Accountx,Passwordx,nicknamex,scorex,px,phoneNox,emailx,sexx,cityx,provincex,countryx,headimgurlx,languagex,ChannelTypex);
		SELECT Id INTO @recordcount FROM newuseraccounts WHERE Account = Accountx;
		INSERT INTO userInfo_imp(userId,score,diamond,giftTicket) VALUES(@recordcount,scorex,0,0);
		INSERT INTO userInfo(userId,firstexchange) values(@recordcount,0);
	END IF;
	
	SET @loginid = 0;
	set @flag = 6;
	/*这个账号的登陆码是否存在*/
	SELECT loginid,loginDate INTO @loginid,@loginDate FROM logintemp WHERE loginid = @recordcount;
	IF (@loginid > 0) THEN
		UPDATE newuseraccounts SET nickname = nicknamex WHERE Account = Accountx;
		SELECT TIMESTAMPDIFF(second,@loginDate,NOW()) into @flag;
		if (@flag > 10) then
			UPDATE logintemp SET logincode = logincodex WHERE loginid = @recordcount;
		else
			SET @ag = 2;
		end if;
	ELSE
		INSERT INTO logintemp(loginid,logincode) VALUES(@recordcount,logincodex);
	END IF;
	
	select @recordcount as rcode,@ag AS ag;
	
    END */$$
DELIMITER ;

